package main
import (
  "bytes"
  "encoding/base64"
  "github.com/computeportal/glui"
)
const (
  dog_data =""
)
var dog = &glui.ImageData{nil, 0, 0}
func load_dog() bool {
  b, err := base64.StdEncoding.DecodeString(dog_data)
  if err != nil {panic(err)}
  buf := bytes.NewBuffer(b)
  data, err := glui.DecodeJPG(buf)
  if err != nil {panic(err)}
  dog.Pix = data.Pix
  dog.W = data.W
  dog.H = data.H
  return true
}
var dog_loaded = load_dog()